import React, { useState, useEffect } from "react";
import HeaderContainer from "../containers/HeaderContainer";
import '../Dashboard/Dashboard.css';
function Cart(props){
    console.log("props",props);
    
    //const userID = sessionStorage.getItem("userID");
    const [msg,setMsg] = useState("");
   
    return(
        <>
             <HeaderContainer />
             <p className="NoData">{msg}</p> 
             <div className="container-fluid">
                 <h4 className="title">Dashboard / Your Cart</h4>
                <div className="row">
                    <div className="col-sm-7">
                        <div className="prd_border">
                           <h5 className="title text-center">Cart List</h5>
                           {props.data?props.data.map(((item, index) => (
                           <div className="itemList">
                             <h4 className="title content">{item.cartData.itemName}</h4>
                             <p>{item.cartData.keyword}</p>
                             <p>Rs. {item.cartData.minPrice}</p>
                             <button type="button" className="btn btn-sm btn-default btn_css" onClick={ () => props.removeToCartHandler()}>Remove to Cart</button>
                            </div>
                             ))):""}
                        </div>
                    </div>
                    <div className="col-sm-5 text-center">
                       <div className="prd_border">
                         <h5 className="title">Cart Details</h5>
                        </div>
                    </div>
                </div>
             </div>
        </>
    );
}
export default Cart;
